HispaClub для тех, кто любит испанский. 

Для тех, кто хочет изучать испанский, найти себе единомышленников и научиться с легкостью общаться на одном из самых прекрасных языков в мире.

Мы предлагаем:
- Испанский для начинающих (уровень А1, А2);
- Средний уровень (уровень В1, В2);
- Продвинутый уровень (уровень С1, С2); 
- Разговорный курс испанского; 
- Интенсивный курс испанского языка;
- Детские группы испанского языка
